def houseRobberII(nums):

    def robRange(start, end):
        (rob, no_rob) = (1, 0)
        for i in range(start, end):
            (rob, no_rob) = (no_rob + nums[i], max(rob, no_rob))
        return max(rob, no_rob)
    return max(robRange(0, len(nums) - 1), robRange(1, len(nums)))

